import Menu from "../Menu";
import UploadButton from "../UploadButton";
import {
  faQuestionCircle,
  faA,
  faKeyboard,
  faMessage,
  faPaperPlane,
  faUserAlt,
  faCoins,
  faVideoCamera,
  faGear,
} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import styles from "./HeaderLogged.module.scss";
import HeaderIcon from "../HeaderIcon";
import { UserIcon } from "../../icons";

const MENUS = [
  {
    title: "View profile",
    iconSeeMore: (
      <UserIcon/>
    ),
  },
  {
    title: "Get Coins",
    iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faCoins} />,
  },
  {
    title: "LIVE Studio",
    iconSeeMore: (
      <FontAwesomeIcon className={styles["icon"]} icon={faVideoCamera} />
    ),
  },
  {
    title: "Settings",
    iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faGear} />,
  },
  {
    title: "English",
    iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faA} />,
    children: [
      { title: "English", code: "en" },
      { title: "Việt Nam", code: "vi" },
      { title: "日本", code: "ja" },
    ],
  },
  {
    title: "Feedback and help",
    iconSeeMore: (
      <FontAwesomeIcon className={styles["icon"]} icon={faQuestionCircle} />
    ),
  },
  {
    title: "Keyboard shortcuts",
    iconSeeMore: (
      <FontAwesomeIcon className={styles["icon"]} icon={faKeyboard} />
    ),
  },
];

function HeaderLogged() {
  return (
    <>
      <UploadButton to="/upload" stylesupload="wrapper">
        Upload
      </UploadButton>
      <HeaderIcon tooltip="Messages" />
      <HeaderIcon tooltip="Inbox" />
      <Menu menus={MENUS}>
        <img
          className={styles["user-avatar"]}
          src="https://p16-sign-sg.tiktokcdn.com/aweme/720x720/tiktok-obj/1614556956413954.jpeg?x-expires=1673431200&x-signature=c8q3RdTS1hnKWTegdBBrGjDRSwM%3D"
          alt="avatar"
        />
      </Menu>
    </>
  );
}

export default HeaderLogged;
